   constructor(props) {
     super(props);
   }
  render() {
    console.log(this.props.colorPlatter)
    return this.props.colorPlatter.map((data, i)=> (
      <div>
        <h3>{data.title}</h3>
      <div className="listOfColor">
       <ListOfColorPlatter  newPlate = {data.data}></ListOfColorPlatter>
       <div style={deleteBUtton}>hello</div>
      </div>
    </div>
    )) 



  }
}
const deleteBUtton = {
  width: "12%",
